var content_f43_46_44779=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PSYCH%2F79549&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PSYCH%2F79549&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    DSM-IV-TR diagnostic criteria for conversion disorder",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        <strong>",
"         A.",
"        </strong>",
"        One or more symptoms or deficits affecting voluntary motor or sensory function that suggest a neurological or other general medical condition.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         B.",
"        </strong>",
"        Psychological factors are judged to be associated with the symptom or deficit because the initiation or exacerbation of the symptom or deficit is preceded by conflicts or other stressors.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         C.",
"        </strong>",
"        The symptom or deficit is not intentionally produced or feigned (as in Factitious Disorder or Malingering).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         D.",
"        </strong>",
"        The symptom or deficit cannot, after appropriate investigation, be fully explained by a general medical condition, or by the direct effects of a substance, or as a culturally sanctioned behavior or experience.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         E.",
"        </strong>",
"        The symptom or deficit causes clinically significant distress or impairment in social, occupational, or other important areas of functioning or warrants medical evaluation.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         F.",
"        </strong>",
"        The symptom or deficit is not limited to pain or sexual dysfunction, does not occur exclusively during the course of somatization disorder, and is not better accounted for by another mental disorder.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Specify type of symptom or deficit:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        With motor symptom or deficit",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        With sensory symptom or deficit",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        With seizures or convulsions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        With mixed presentation",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reprinted with permission from the Diagnostic and Statistical Manual of Mental Disorders, Text Revision, Fourth Edition. Copyright &copy; 2000 American Psychiatric Association.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
