"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ALLRG%2F70867&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
