"     Reproduced with permission from: Biro FM. Physical growth and development. In: Principles of Adolescent Medicine, Friedman SB, Fisher M, Schonberg SK. Mosby-Year Book, Inc, 1997. Figure 6-3, p.31. Copyright &copy;1997 Elsevier.",
