var title_f43_46_44782="CCK test for achalasia";
var content_f43_46_44782=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F74209&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F74209&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    The cholecystokinin (CCK) octapeptide test for achalasia",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 285px; height: 186px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    CCK has a dual effect on the lower esophageal sphincter (LES): it stimulates smooth muscle contraction and the release of inhibitory neurotransmitters. Administration of CCK normally causes the LES pressure to fall because the effect on inhibitory neurotransmitters is greater. In patients with achalasia, CCK causes the LES pressure to rise.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reprinted, courtesy of the Clinical Teaching Project of the American Gastroenterological Association&copy;. This slide cannot be downloaded but may be purchased as part of a set from the AGA through Milner-Fenwick, Inc. at 1-800-432-8433.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
